    $('[rel="popover"]').on('show.bs.popover', function () {
      var id = $(this).data('popover-id');
      if (id) {
        $(this).attr('data-content', $('#' + id).html());
      }
    });



    // Executes only in XS breakpoint
    // if(viewport.is('xs')) {
